import React from 'react';
import '../styles/NewButton.css';
// Header 컴포넌트 정의
function NewButton() {
  return (
    <button
      style={newButtonStyle}
      onMouseEnter={() => setIsHovered(true)}
      onMouseLeave={() => setIsHovered(false)}
    >+New</button>
  );
}

export default NewButton;
